import React from 'react';
import "../node_modules/bootstrap/dist/css/bootstrap.min.css";
const Header = () =>{
    return(
        <>
        <nav class="navbar navbar-light bg-light">
  <span class="navbar-brand mb-0 h1">Navbar</span>
</nav>
        </>
    );
};
export default Header;
